import React, { useState, useEffect } from 'react';
import Table from 'react-bootstrap/Table';
import axios from 'axios';

const SearchDelete = () => {
  const [data, setData] = useState([]);
  const authAxios = axios.create({ baseURL: 'https://departments-a9275-default-rtdb.firebaseio.com/' })

  useEffect(() => {

  fetchData();

  })
  function fetchData(params) {
    authAxios.get('/.json').then((response) => {
      setData(response.data);
    })
  }

  function DeleteById(id) {
    id = id - 1;
    authAxios.delete(`${id}.json`).then((res) => {
      alert("Deleted Successfully");
    }).catch((err)=>{})
  }




  return (
    <Table striped bordered hover>
      <thead>
        <tr>
          <th>ID</th>
          <th>NAME</th>
          <th>AGE</th>
        </tr>
      </thead>
      <tbody>
        {
          data.map((row) => (
            <tr key={row.ID}>
              <td>{row.ID}</td>
              <td>{row.Name}</td>
              <td>{row.age}</td>
              <td><button type="button" onClick={() => DeleteById(row.ID)}  className="btn btn-danger">Delete</button>
              </td>
            </tr>

          ))}
      </tbody>
    </Table>

  );
};

export default SearchDelete;
